import Topnav from './Topnav';
import { Container } from 'semantic-ui-react';

const Layout = ({ children }) => {
    return (
        <React.Fragment>
            <Topnav />
            <Container>
                { children }
            </Container>
        </React.Fragment>
    )
}

export default Layout;
